import React from 'react'
import { NavLink } from "react-router-dom";
import ProjectImg from '../images/modernism.jpg';

function ProjectCard() {
    return (
       <>
          <div className='main_project'>
                <div className='central_project'>
                    <div className="gallery">
                        <NavLink target="_blank" to="/">
                            <img src={ProjectImg} alt="Cinque Terre" />
                        </NavLink>
                        <div className="desc">Add description of the image here</div>
                    </div>
                </div>
            </div>
       </>
    )
}

export default ProjectCard
